private CustomArgument<Objective> objectiveArgument() { Scoreboard scoreboard = Bukkit.getScoreboardManager().getMainScoreboard(); /* Create our CustomArgument instance. This takes an input of a * lambda that takes in a String and returns an Objective object. */ return new CustomArgument<Objective>((input) -> { //Parse the objective if(scoreboard.getObjective(input) == null) { //Throw a custom error to the user if it fails to get the objective CustomArgument.throwError(new MessageBuilder("Unknown objective: ").appendArgInput()); return null; } else { return scoreboard.getObjective(input); } //Use .overrideSuggestions to suggest the list of names of objectives }).overrideSuggestions(scoreboard.getObjectives().stream().map(o -> o.getName()).toArray(String[]::new));
